import './Table.css';
import Checkbox from '../common/Checkbox';
import React from 'react';
import Orders from '../../data/Orders.json'

const Table = ({}) => {
  return (
    <div className="table">
        <table>
            <thead>
                <th></th>
                <th>#</th>
                <th>Дата</th>
                <th>Статус</th>
                <th>Позиций</th>
                <th>Сумма</th>
                <th>ФИО покупателя</th>
            </thead>
        </table>
    </div>
  );
}

export default Table;
